import Link from 'next/link';

const Home = () => {
  return (
    <nav>
      <ul>
        <li>
          <Link href="/">
            <a>Home</a>
          </Link>
        </li>
        <li>
          <Link href="/users">
            <a>Users from Github repo</a>
          </Link>
        </li>
      </ul>
    </nav>
  );
};

export default Home;
